import React from 'react';
import './Date.css';

function DateCurrent(){
   
    const date = new Date();

    const currentTime = date.getHours();
   
    let message;

    if(currentTime < 12){
        message = "Good Morning";

    }
    else if(currentTime > 18){
        message = "Good Afternoon"
    }
    else{
        message = "Good Evening"
    }

    console.log(message);

    return(
        <div className="dateset">
            <h1>{message}</h1>
        </div>
    );
}

export default Date
